            var user = JSON.parse(localStorage.getItem('user'));
            user.sucursal = sucursal;
            user.idSucursales = sucursal.idSucursales;
            user.principal = sucursal.principal;
            user.idmunicipioSucursal = sucursal.idmunicipio;
            user.nombreSucursal = sucursal.nombreSucursal;
            user.idTipoEmpresa = sucursal.idTipoEmpresa;
            _this.userService.saveLocalStorage(user, 'user');
            _this.settingsService.actualizarInfo.emit(true);
            if (tipo === 'empleado') {
                _this.userService.getMenuParametros({ idMembers: user.idMembers, idSucursal: user.idSucursales, plataforma: 'WEB' }).subscribe(function (menu) {
                    _this.userService.saveLocalStorage(menu[0].menu, 'menu');
                    _this.settingsService.mostrarMenu.emit(user);
                });
            }
            _this.appService.swal('', "Cambio de sesi\u00F3n a " + sucursal.nombreSucursal, 'success');
